import React from 'react';
import {
    ChakraProvider,
    Box,
    Text,
    Link,
    VStack,
    Code,
    Grid,
    theme,
    Container,
    Flex,
    Center,
    Square,
    Stack,
    Button,

} from '@chakra-ui/react';

import {
    EmailIcon,
    ArrowForwardIcon,
} from '@chakra-ui/icons'

const LandingPage = () => {
    return (
        <Container
            maxW='container.lg'
            bg='pink'
            color='#262626'>
            <Flex color='white' minHeight='50%'>
                <Box flex='1' bg='white' minHeight='7vh' color='black' justifyContent={'end'} >
                    <Text
                        color='#8B8B8B'
                        lineHeight={{ 'sm': '8vh', 'md': '9vh' }}
                        align='initial'
                        fontSize={{ 'sm': '36', 'md': '48' }}
                        fontWeight='bold'
                    //bgColor={'blue'}
                    >
                        I am
                    </Text>
                    <Text
                        lineHeight={{ 'sm': '7vh', 'md': '8vh' }}
                        align='initial' fontSize={{ 'sm': '36', 'md': '48' }}
                        fontWeight={700}
                    //bgColor='green.200'
                    >
                        Samuel YAKOBUS
                    </Text>
                    <Stack direction='row' spacing={4}>
                        <Button leftIcon={<EmailIcon />} colorScheme='teal' variant='solid'>
                            Email
                        </Button>
                        <Button rightIcon={<ArrowForwardIcon />} colorScheme='teal' variant='outline'>
                            Call us
                        </Button>
                    </Stack>
                </Box>
                <Box flex='1' bg='tomato'>
                    <Text>Box 2</Text>
                </Box>
            </Flex>
        </Container >

    );
}

export default LandingPage;
